import Monitor from "./src_assets/LG_Monitor_90s_iseonyoon.png";

function App() {
  return (
    <div className="App">
      <header className="App-header" style="position: relative;">
        <div class="gradient-border" id="box" style="position: absolute;">
          Animated CSS Gradient Border
        </div>
        <img src={Monitor} className="Monitor" alt="logo" />
      </header>
      <body></body>
    </div>
  );
}

export default App;
